As described in the official document, lory.js can be imported as follows.

```ts
import {lory} from 'lory.js';

document.addEventListener('DOMContentLoaded', () => {
    const slider = document.querySelector('.js_slider');

    lory(slider, {
        // options going here
    });
});
```

Thus, variable `lory` should be exported.

It is useful to be able to extract the props type for a given component type, as often the props type can change after applying HOCs.

This PR proposes a `GetComponentProps` helper to do just that:

``` ts
interface MyComponentClassProps { bar: string; }
declare const MyComponentClass: React.ComponentClass<MyComponentClassProps>;

interface MyStatelessComponentProps { bar: string; }
declare const MyStatelessComponent: React.StatelessComponent<MyStatelessComponentProps>;

// $ExpectType MyComponentClassProps
type MyComponentClassPropsExtracted = React.GetComponentProps<typeof MyComponentClass>;
// $ExpectType MyStatelessComponentProps
type MyStatelessComponentPropsExtracted = React.GetComponentProps<typeof MyStatelessComponent>;
```

Currently I have to do this which is quite awkward and involves a redundant runtime calculation:

``` ts
interface MyComponentClassProps { bar: string; }
declare const MyComponentClass: React.ComponentClass<MyComponentClassProps>;

interface MyStatelessComponentProps { bar: string; }
declare const MyStatelessComponent: React.StatelessComponent<MyStatelessComponentProps>;

const getProps = function<Props> (_MyComponent: React.ComponentType<Props>): Props {
  return {} as Props;
};
const myComponentClassPropsExtracted = getProps(MyComponentClass);
const myStatelessComponentPropsExtracted = getProps(MyStatelessComponent);

// $ExpectType MyComponentClassProps
type MyComponentClassPropsExtracted = typeof myComponentClassPropsExtracted;
// $ExpectType MyStatelessComponentProps
type MyStatelessComponentPropsExtracted = typeof myStatelessComponentPropsExtracted;
```

https://stackoverflow.com/questions/43230765/typescript-react-access-component-property-types/49193798#49193798

Other people seem to want this:

- https://stackoverflow.com/questions/43230765/typescript-react-access-component-property-types
- https://stackoverflow.com/questions/44851268/typescript-how-to-extract-the-generic-parameter-from-a-type

If this looks good I will copy the changes into the v16 types.

